import math
import itertools

def calculate_distance(points):
    """"""
    distances = {}
    for ((x1, y1), (x2, y2)) in itertools.combinations(points, 2):
        distance = math.sqrt((x2 - x1) ** 2 + (y2 - y1) ** 2)
        distances[(x1, y1), (x2, y2)] = distance
        distances[(x2, y2), (x1, y1)] = distance
    for point in points:
        distances[point, point] = 0
    return distances
